import React from 'react'
import { useParams } from 'react-router-dom'

function BookList() { const {id} = useParams()
  return (
    <div>
      <Link to='hello/1'>Book lkalb</Link>
        <Link to='hello/2'>Book</Link>
        <h1>hello everybody {id}</h1>
    </div>
  )
}

export default BookList
